import React from "react";
import {
  SideBarContainer,
  Icon,
  CloseIcon,
  SideBarWrapper,
  SideBarMenu,
  SideBarLink,
  SideBtnWrap,
  SideBarRouter,
} from "./SideBarElements";

const index = (isOpen, toggle) => {
  return (
    <SideBarContainer >
      <Icon >
        <CloseIcon />
      </Icon>
      <SideBarWrapper>
        <SideBarMenu>
          <SideBarLink to="about">About</SideBarLink>
          <SideBarLink to="discover">Discover</SideBarLink>
          <SideBarLink to="servies">Services</SideBarLink>
          <SideBarLink to="signup">Sign up</SideBarLink>
        </SideBarMenu>
        <SideBtnWrap>
          <SideBarRouter to="/signin">Sign In</SideBarRouter>
        </SideBtnWrap>
      </SideBarWrapper>
    </SideBarContainer>
  );
};

export default index;
